import logo from './logo.svg';
import React, {Component} from 'react';
//import './App.css';
import {AppBar, Toolbar} from "@material-ui/core"
import FilteredList from "./FilteredList";
import Pomegranate from "./pomegranate.jpg";
import Mango from "./mango.jpg";
import Orange from "./Orange.jpg";
import Kiwi from "./kiwi.jpg";
import Rambutaan from "./rambuttan.jpg";
import Raspberry from "./raspberry.jpg";
import Apple from "./apple.jpg";
import Coconut from "./Coconuts.jpg";
import Fig from "./figs.jpg";
import Papaya from "./papaya.png";
import Peach from "./Peach.jpg";
import Lime from "./lime.jpg";


const produce = [
  { name: "Pomegranate", size: "Medium", type: "berry", img: Pomegranate, rating: 4, price: 10,},
  { name: "Orange", size: "Medium", type: "citrus", img: Orange, rating: 6, price: 10},
  { name: "Apple", size: "Small", type: "pome", img: Apple, rating: 4, price: 10},
  { name: "Kiwi", size: "Small", type: "berry", img: Kiwi, rating: 3, price: 10  },
  { name: "Rasberry", size: "Small", type: "berry", img: Raspberry, rating: 5, price: 10},
  { name: "Rambutaan", size: "Small", type: "berry" ,img: Rambuttan, rating: 2, price: 10 },
  { name: "Coconut", size: "Large", type: "drupe", img: MPhone, rating:7, price: 10 },
  { name: "Papaya", size: "Large", type: "berry", img: MPhone, rating:8, price: 10},
  { name: "Mango", size: "Large", type: "drupe", img: Mango,rating:9, price: 10 },
  { name: "Lime", size: "Small", type: "citrus", img: MPhone, rating:11, price: 10 },
  { name: "Fig", size: "Small" ,type: "berry", img: MPhone, rating:10, price: 10},
  { name: "Peach", size: "Medium", type: "drupe", img: MPhone ,rating:1, price: 10 }
];

class App extends Component {

  render() {
    return (
      <div className="App">
      <h1 id ="title" > Fruit Stand</h1>
        <FilteredList items = {produce}/>
      </div>
    );
  }
}

export default App;
